import React from 'react'
import { useLocation } from 'react-router-dom';

export default function Detail() {
    const location = useLocation();
    const moviedetails = location.
    return (
        <div>
            <h2>Detail</h2>
            <div>{location.state.movie.title}</div>
        </div>
    )
}
